import React, { useState } from "react";
import "../../assets/css/compeounder.css";
import "../../assets/css/innerstyle.css";
// import "../../assets/css/bootstrap/dist/css/bootstrap.min.css";


const TablePannelPage = () => {
 

  return (
    <div>
             <div className="tab-pane fade" id="Support" role="tabpanel" aria-labelledby="Support-tab">
                                <div className="row align-items-center">
                                    <div className="col-md-8">
                                        <div className="homeHeading">
                                            <h2>Our Support Team is here to Help You</h2>
                                            <p>Contact us to get your issue resolved as soon as Possible</p>
                                        </div>
                                        <a href="#" className="readmoreBtn"><span>Contact Support</span></a>
                                    </div>
                                    <div className="col-md-4">
                                        <div className="supportImg">
                                            <img src="images/customer-support.png" />
                                        </div>
                                    </div>
                                </div>
                            </div>
    </div>
  );
};

export default TablePannelPage;
